import React, {useState, useEffect} from 'react';
import axios from 'axios';
import Header from '../../components/Header';
import Sidebar from '../../components/Sidebar';
import Footer from '../../components/Footer';
import { useNavigate } from 'react-router-dom';

const ManageReseller = ({ userInfo, handleLogout }) => { 
    const navigate = useNavigate();

    const handleAddReseller = () => {
        navigate('/superadmin/AddManageReseller');
    };

    const handleViewReseller = () => {
        navigate('/superadmin/ViewManageReseller');
    };

    const handleEditReseller = () => {
        navigate('/superadmin/EditManageReseller');
    };

    const handleAssignClient = () => {
        navigate('/superadmin/AssignClient');
    };

    const handleAssignCharger = () => {
        navigate('/superadmin/AssignCharger');
    };

    const [data, setData] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const [filteredData] = useState([]);
    const [posts, setPosts] = useState([]);

    // Get manage charger data
    useEffect(() => {
        // Define the API URL based on the event detail
        const url = `/superadmin/FetchResellers`;
        axios.get(url).then((res) => {
            // console.log('Data fetched successfully:', res.data);
            setData(res.data.data); // Assuming the data you need is inside the 'data' property
            setLoading(false);
            // console.log(JSON.stringify(res.data) + ' charger data');
        })
           .catch((err) => {
            console.error('Error fetching data:', err);
            setError('Error fetching data. Please try again.');
            setLoading(false);
          });
    }, []);

    // Search data 
    const handleSearchInputChange = (e) => {
        const inputValue = e.target.value.toUpperCase();
        // Ensure data is an array before filtering
        if (Array.isArray(data)) {
            const filteredData = data.filter((item) =>
                item.charger_id.toUpperCase().includes(inputValue)
            );
            // Update the search state with the filtered results
            setPosts(filteredData);
        }
    };

    // Update table data 'data', and 'filteredData' 
    useEffect(() => {
        switch (data) {
            case 'filteredData':
                setPosts(filteredData);
                break;
            default:
                setPosts(data);
                break;
        }
    }, [data, filteredData]);

    // Timestamp data 
    function formatTimestamp(originalTimestamp) {
        const date = new Date(originalTimestamp);
        const day = String(date.getDate()).padStart(2, '0');
        const month = String(date.getMonth() + 1).padStart(2, '0');
        const year = date.getFullYear();

        let hours = date.getHours();
        const minutes = String(date.getMinutes()).padStart(2, '0');
        const seconds = String(date.getSeconds()).padStart(2, '0');
        const ampm = hours >= 12 ? 'PM' : 'AM';
        hours = hours % 12;
        hours = hours ? hours : 12; // the hour '0' should be '12'
        hours = String(hours).padStart(2, '0');

        const formattedDate = `${day}/${month}/${year} ${hours}:${minutes}:${seconds} ${ampm}`;
        return formattedDate;
    } 

    return (
        <div className='container-scroller'>
            {/* Header */}
            {/* <Header/> */}
            <Header userInfo={userInfo} handleLogout={handleLogout} />
            <div className="container-fluid page-body-wrapper">
                {/* Sidebar */}
                <Sidebar/>
                <div className="main-panel">
                    <div className="content-wrapper">
                        <div className="row">
                            <div className="col-md-12 grid-margin">
                                <div className="row">
                                    <div className="col-12 col-xl-8 mb-4 mb-xl-0">
                                        <h3 className="font-weight-bold">Manage Reseller</h3>
                                    </div>
                                    <div className="col-12 col-xl-4">
                                        <div className="justify-content-end d-flex">
                                            <button type="button" className="btn btn-success" onClick={handleAddReseller}>Create</button>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div className="row">
                            <div className="col-lg-12 grid-margin stretch-card">
                                <div className="card">
                                    <div className="card-body">
                                        <div className="row">
                                            <div className="col-md-12 grid-margin">
                                                <div className="row">
                                                    <div className="col-4 col-xl-8">
                                                        <h4 className="card-title" style={{paddingTop:'10px'}}>List Of Reseller</h4>  
                                                    </div>
                                                    <div className="col-8 col-xl-4">
                                                        <div className="input-group">
                                                            <div className="input-group-prepend hover-cursor" id="navbar-search-icon">
                                                                <span className="input-group-text" id="search">
                                                                <i className="icon-search"></i>
                                                                </span>
                                                            </div>
                                                            <input type="text" className="form-control" placeholder="Search now" aria-label="search" aria-describedby="search" autoComplete="off" onChange={handleSearchInputChange}/>
                                                        </div>
                                                    </div>
                                                </div>
                                            </div>
                                        </div>
                                        <div className="table-responsive">
                                            <table className="table table-striped">
                                                <thead style={{textAlign:'center'}}>
                                                    <tr> 
                                                        <th>Sl.No</th>
                                                        <th>Reseller Name</th>
                                                        <th>Phone Number</th>
                                                        <th>Emial ID</th>
                                                        <th>Address</th>
                                                        <th>Created Date</th>
                                                        <th>Modified Date</th>
                                                        <th>Statussss</th>
                                                        <th>Active/DeActive</th>
                                                        <th>Option</th>
                                                        <th>Assign Client</th>
                                                        <th>Assign Charger</th>
                                                    </tr>
                                                </thead>
                                                <tbody style={{textAlign:'center'}}>
                                                    {loading ? (
                                                        <tr>
                                                            <td colSpan="10" style={{ marginTop: '50px', textAlign: 'center' }}>Loading...</td>
                                                        </tr>
                                                    ) : error ? (
                                                        <tr>
                                                            <td colSpan="10" style={{ marginTop: '50px', textAlign: 'center' }}>Error: {error}</td>
                                                        </tr>
                                                    ) : (
                                                        Array.isArray(posts) && posts.length > 0 ? (
                                                            posts.map((dataItem, index) => (
                                                            <tr key={index}>
                                                                <td>{index + 1}</td>
                                                                <td>Spark Minda</td>
                                                                <td style={{textAlign:'center'}}>9807651234</td>
                                                                <td style={{textAlign:'center'}}>sparkminda@gmail.com</td>
                                                                <td style={{textAlign:'center'}}>Bangalore</td>
                                                                <td>{formatTimestamp(dataItem.created_date)}</td>
                                                                <td>{formatTimestamp(dataItem.modified_date)}</td>
                                                                <td>{dataItem.status === true ? 'Active' : 'DeActive'}</td>

                                                                <td style={{textAlign:'center'}}>
                                                                    <div className='form-group'> 
                                                                            <div className="form-check form-check-success">
                                                                                <label className="form-check-label"><input type="radio" className="form-check-input" name="optionsRadios1" id="optionsRadios1" value="Active" />Active<i className="input-helper"></i></label>
                                                                            </div>
                                                                            <div className="form-check form-check-danger">
                                                                                <label className="form-check-label"><input type="radio" className="form-check-input" name="optionsRadios1" id="optionsRadios2" value="UnActive" />UnActive<i className="input-helper"></i></label>
                                                                            </div>
                                                                        </div>
                                                                </td>
                                                                <td>
                                                                    <button type="button" className="btn btn-outline-success btn-icon-text" onClick={handleViewReseller} style={{marginBottom:'10px', marginRight:'10px'}}><i className="mdi mdi-eye"></i>View</button> 
                                                                    <button type="button" className="btn btn-outline-primary btn-icon-text" onClick={handleEditReseller} style={{marginBottom:'10px', marginRight:'10px'}}><i className="mdi mdi-pencil btn-icon-prepend"></i>Edit</button><br/>
                                                                </td>
                                                                <td style={{textAlign:'center'}}>
                                                                    <button type="button" className="btn btn-outline-warning btn-icon-text" onClick={handleAssignClient}><i className="ti-file btn-icon-prepend"></i>Client</button><br/>
                                                                </td>
                                                                <td style={{textAlign:'center'}}>
                                                                    <button type="button" className="btn btn-outline-warning btn-icon-text" onClick={handleAssignCharger}><i className="ti-file btn-icon-prepend"></i>Charger</button> 
                                                                </td>
                                                            </tr>
                                                        ))
                                                        ) : (
                                                        <tr>
                                                            <td colSpan="10" style={{ marginTop: '50px', textAlign: 'center' }}>No devices found</td>
                                                        </tr>
                                                        )
                                                    )}
                                                </tbody>
                                            </table>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                    {/* Footer */}
                    <Footer />
                </div>         
            </div>    
        </div>
    )
}   

export default ManageReseller
